export default class BtnTest extends Component {
  handleClick1 = () => {
    console.log("Oiiii amigão!!!");
  }

  handleClick2 = () => {
    console.log("Oiiii coração!!!");
  }

  handleClick3 = () => {
    console.log("Oiiii Lindeza!!!");
  }

  render() {
    return (
      <div>
        <button type="button" onClick={ this.handleClick1 }>
          Inprimir Texto 1
        </button>
        <button type="button" onClick={ this.handleClick2 }>
          Inprimir Texto 2
        </button>
        <button type="button" onClick={ this.handleClick3 }>
          Inprimir Texto 3
        </button>
      </div>
    )
  }
}
